GeoJson.Feature requires `properties` parameter, but default type `GeoJsonProperties` is nullable.

```
export interface Feature<G extends GeometryObject | null, P = GeoJsonProperties> extends GeoJsonObject {
    type: "Feature";
    geometry: G;
    id?: string | number;
    properties: P;
}

export type GeoJsonProperties = { [name: string]: any; } | null;
```

I should use this type as below.
```
{
  type: 'Feature',
  geometry: {...},
  properties: null
  //----------^--- I think this property should be nullable.
}
```

How do you think?

